import React from 'react'

function AdminDashboard() {
    return (
        <div>
            <link to="/searchBY">Search Alumni</link>
            <link to="/addnotablealumni">Add a Notable Alumni</link>
            <link to="/sendmessage">Send a Message</link>
        </div>
    )
}

export default AdminDashboard
